import React from 'react';
import './Home.css'

function Home() {
  var i = 0;
  var txt = 'Lorem ipsum dummy text blabla.';
  var speed = 50;
  var pause = 1000;

  function typeWriter() {

    useEffect(() => {
      // Update the document title using the browser API
      document.title = `You clicked ${count} times`;
    });
    if (i < txt.length) {
      document.getElementById("typedtext").innerHTML += txt.charAt(i);
      i++;
      setTimeout(typeWriter, speed);
    }
    else {
      setTimeout(typeDeleter, pause);
    }
  }
  function typeDeleter() {
    if (i > 0) {
      document.getElementById("typedtext").innerHTML = document.getElementById("typedtext").innerHTML.slice(0, -1);
      i--;
      setTimeout(typeDeleter, speed);
    }
  }
  typeWriter();
  return (
  <div className="home">
    <div className="tagline">
      <h1>Deep Learning</h1>
      <h5>Because algorithms are too hard</h5>
      <h5 id="typedtext"></h5>
    </div>
  </div>);
}
export default Home;
